        <script>
            window.getBaseVersionedPath = function() { return "https://uci.officeapps.live.com/OfficeInsights/Agave/Web"; }

            function loadScript(src, callback, onerror) {
                var head = document.getElementsByTagName('head')[0];
                var script = document.createElement('script');
                var done = false;
                script.setAttribute('src', src);
                script.setAttribute('type', 'text/javascript');
                script.setAttribute('charset', 'utf-8');
                script.onload = script.onreadstatechange = function() {
                    if (!done && (!this.readyState || this.readyState == 'loaded' || this.readyState == 'complete')) {
                        done = true;
                        script.onload = script.onreadystatechange = null;
                        if (callback) {
                            callback();
                        }
                    }
                };
                script.onerror = function() {
                    // set this to null to avoid this gets called again by loaded script internal error
                    script.onerror = null;
                    if (onerror) {
                        onerror();
                    }
                };
                head.insertBefore(script, head.firstChild);
            }

            function bootApp(language, callback) {
                // load localized Javascript file
                loadScript("https://uci.officeapps.live.com/OfficeInsights/Agave/Web/scripts/microsoft.office.smartlookup.client." + language + ".js", 
                function() {
                    if(callback) {
                        callback();
                    }
                },
                function() {
                    // if somehow (for example, agave change the language parameter on URL) it's failed to load localized JavaScript, just fall back to English always
                    // This may have some performance downgrade, but better than breaking the Serplet totally
                    loadScript("https://uci.officeapps.live.com/OfficeInsights/Agave/Web/scripts/microsoft.office.smartlookup.client.en-us.js"), function() {
                        if(callback) {
                            callback();
                        }
                    }
                });
            }
            window.bootApp = bootApp;
            window.isBrowserPane = function() { return window.location.href.search('isBrowserPane') >= 0; }
            window.isWac = function() { return false; }

        <script>
            window.updateBkgColor = function() {
                const queryString = window.location.search.slice(1);
                if (queryString && queryString.length > 0) {
                    const params = queryString.split('&');
                    for (let i = 0; i < params.length; i++) {
                        if (params[i] && params[i].length > 0) {
                            const paramPair = params[i].split('=');
                            if (paramPair && paramPair.length == 2) {
                                if (paramPair[0] == 'apptheme') {
                                    const paramVal = paramPair[1];
                                    switch (paramVal) {
                                        case '0':
                                            document.body.style.backgroundColor = 'rgba(230,230,230,1.00)';
                                            break;

                                        case '2':
                                        case '3':
                                            document.body.style.backgroundColor = 'rgba(102,102,102,1.00)';
                                            break;

                                        case '4':
                                            document.body.style.backgroundColor = 'rgba(38,38,38,1.00)';
                                            break;

                                        case '5':
                                            document.body.style.backgroundColor = 'rgba(255,255,255,1.00)';
                                            break;
                                    }
                                    break;
                                }
                            }
                        }
                    }
               }
            }
            window.updateBkgColor();
        </script>
